import React, { Component } from 'react';
import './App.css';
import Menu from './Menu.js'
import MapContainer from './MapContainer'
// import ReactRoutes from './ReactRoutes'
import { BrowserRouter as Router, Route } from 'react-router-dom'
import AllTitlesList from './AllTitlesList';
import AllActorsList from './AllActorsList';
const APIlatlng = '/LatLng'


// import { Button } from 'react-bootstrap';

class App extends Component {
  constructor(props) {
    super(props);
  //   this.handleChange = this.handleChange.bind(this)
    this.state = {
      "locations": []
    }
  }

  loadLatLng(){
    fetch(APIlatlng, {
      headers: {"content-type": "application/json"}
    })
    .then(resp => {
      if (!resp.ok) {
        if (resp.status >= 400 && resp.status < 500) {
          return resp.json().then(data => {
            let err = {
              errorMessage: data.message
            };
            throw err;
          });
        } else {
          let err = {
            errorrMessage: "Error FETCHING and parsing data from postgres dbðŸ˜³"
          };
          throw err;
        }
      }
      return resp.json();
    })
    .then(events => this.setState({
      events
    }));
}

  componentDidMount() {
    this.setState(loadLatLng);
  }

  render(){
    return (
      <div className="bg-dark">
        <div className="App">
          <Router>
            <Menu />
            <MapContainer />
                <div>
                    <Route path='/AllTitles' component={AllTitlesList}/>
                    <Route path='/AllActors' component={AllActorsList}/>
                </div>
          </Router>
        </div>
      </div>
    );
  }
}

